s:679:"<div id="v-JrFIi2mr-1" class="video-player">\n</div>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/16413/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/16413/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=16413&subd=wptv&ref=&feed=1" width="1" height="1" /><div><a href="http://wordpress.tv/2013/02/20/scott-basgaard-help-yourself-by-helping-others/"><img alt="Scott Basgaard &#8211; Help Yourself by Helping Others" src="http://videos.videopress.com/JrFIi2mr/video-1b5f774479_std.original.jpg" width="160" height="120" /></a></div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 20 Feb 2013 19:00:13 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"WordPress.tv";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:58:"Weblog Tools Collection: Twenty Thirteen Theme in Progress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12687";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/3tj7MIPbhOc/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1919:"<p>The new default theme for <a href="http://wordpress.org">WordPress</a> 3.6, titled Twenty Thirteen, is <a href="http://make.wordpress.org/core/2013/02/18/introducing-twenty-thirteen/">making progress</a>. This year&#8217;s default theme is overseen by <a href="http://ma.tt">Matt Mullenweg</a>, and built by <a href="http://noscope.com">Joen Asmussen</a>, <a href="http://en.wp.obenland.it">Konstantin Obenland</a>, and <a href="http://simpledream.net">Lance Willett</a>.</p>\n<p>The goal for Twenty Thirteen is to offer &#8220;a focus on blogging, and great support for post formats (which are getting <a href="http://make.wordpress.org/core/tag/post-formats/">attention</a> on the backend in 3.6 as well).&#8221;</p>\n<p>If you&#8217;d like to see the theme in action, <a href="http://twentythirteendemo.wordpress.com">a demo site</a> is available. One thing you&#8217;ll notice immediately is that the strong emphasis on whitespace, which has become commonplace in the default themes, is long-gone. Twenty Thirteen is making very bold use of its colors, offering a different color for each post format. The theme also lacks a sidebar by default. It&#8217;s designed to focus on blogging after all, so the designers prefer that you leave your widgets to the footer area, but it still does support a sidebar widget area if you really want to put something there.</p>\n<p>This theme won&#8217;t be for everyone, and really no default theme should. Default themes should showcase the strength of each release&#8217;s new features and inspire customization. If you aren&#8217;t a fan of Twenty Thirteen, don&#8217;t worry, there are still <a href="http://wordpress.org/extend/themes/">over 1,600 themes</a> to choose from, including <a href="http://wordpress.org/extend/themes/twentytwelve">Twenty Twelve</a>.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/3tj7MIPbhOc" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pu