s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/-gw-jcZ6nSQ/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1570:"<p>Some of you may remember that <a href="https://posterous.com">Posterous</a> was <a href="http://weblogtoolscollection.com/archives/2012/03/15/posterous-acquired-by-twitter/">acquired by Twitter</a> almost a year ago. At the time, the future of the service was in doubt, and they have <a href="http://blog.posterous.com/thanks-from-posterous">just announced today</a> that the service will be shutting down on April 30.</p>\n<p>If you&#8217;re still with Posterous, it&#8217;s not too late to move your blog elsewhere. If you prefer hosted blogging services, like Posterous, you can move to <a href="http://wordpress.com">WordPress.com</a> following <a href="http://en.support.wordpress.com/import/import-from-posterous/">this guide</a> and <a href="http://www.squarespace.com">Squarespace</a> following <a href="http://help.squarespace.com/customer/portal/articles/881311-importing-content-from-posterous">this guide</a>. If you&#8217;d rather have more control over the hosting and permanence of your content, it might be time to find yourself a hosting provider so you can install and run <a href="http://wordpress.org">WordPress</a> yourself and use <a href="http://wordpress.org/extend/plugins/posterous-importer/">this importer</a> to bring over your Posterous content.</p>\n<p>Don&#8217;t delay! The service will be completely shutting down on April 30, which means that you will not be able to edit or even view your Posterous blog past that date.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/-gw-jcZ6nSQ" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sat, 16 Feb 2013 01:45:09 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:24;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:59:"Weblog Tools Collection: WordPress Plugin Releases for 2/15";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12657";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/y8jGs8JJ1kA/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1017:"<h3>New plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/debugger/"><strong>Debugger</strong></a> can be used to manually log data or to capture logging on WordPress actions. You can capture load time, memory, backtrace, data dumps, urls, and server IPs.</p>\n<p><a href="http://wordpress.org/extend/plugins/feedback-extended/"><strong>Feedback Extended</strong></a> enables users to reply to feedbacks from the admin panel, requires <a href="http://jetpack.me">Jetpack</a>.</p>\n<h3>Updated plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/facebook/"><strong>Facebook</strong></a> makes your site deeply social by integrating functionality from Facebook.</p>\n<p><a href="http://wordpress.org/extend/plugins/yet-another-related-posts-plugin/"><strong>Yet Another Related Posts Plugin</strong></a> displays a list of related entries on your site and feeds based on a unique algorithm.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/y8jGs8JJ1kA" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 15 Feb 2013 20:15:06 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:25;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:44:"WordPress.tv: Alison Barrett: Admin Creation";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wordpress.tv/?p=16332";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:61:"http://wordpress.tv/2013/02/15/alison-barrett-admin-creation/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:638:"<div id="v-4AEebg4X-1" class="video-player">\n</div>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/16332/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/16332/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=16332&subd=wptv&ref=&feed=1" width="1" height="1" /><div><a href="http://wordpress.tv/2013/02/15/alison-barrett-admin-creation/"><img alt="Alison Barrett: Admin Creation" src="http://videos.videopr