te.</p>\n<p><a href="http://wordpress.org/extend/plugins/wp-snippets/"><strong>WP Snippets</strong></a> makes it very easy to reuse fragments of content (i.e. Snippets).</p>\n<h3>Updated plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/facebook/"><strong>Facebook</strong></a> makes your site deeply social by integrating functionality from Facebook.</p>\n<p><a href="http://blog.milandinic.com/wordpress/plugins/nav-menu-images/"><strong>Nav Menu Images</strong></a> enables uploading of images for nav menu items on the menu edit screen.</p>\n<p><a href="http://wordpress.org/extend/plugins/osm/"><strong>OSM</strong></a> displays maps in your WordPress blog using the OpenLayers technology.</p>\n<p><a href="http://wordpress.org/extend/plugins/w3-total-cache/"><strong>W3 Total Cache</strong></a> allows you to improve site performance and user experience via caching.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/RDb_qZjtN1E" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 11 Feb 2013 19:40:17 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:45;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:60:"WordPress.tv: Aaron Campbell: Community – Getting Involved";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wordpress.tv/?p=13354";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s: