(1, 1, '2013-02-20 20:12:11', '2013-02-20 20:12:11', 'Bem-vindo ao WordPress. Esse é o seu primeiro post. Edite-o ou exclua-o, e então comece a publicar!', 'Olá, mundo!', '', 'publish', 'open', 'open', '', 'ola-mundo', '', '', '2013-02-20 20:12:11', '2013-02-20 20:12:11', '', 0, 'http://corporeum.com.br/inverno13/?p=1', 0, 'post', '', 1),
(2, 1, '2013-02-20 20:12:11', '2013-02-20 20:12:11', 'Esta é uma página de exemplo. É diferente de um post porque ela ficará em um local e será exibida na navegação do seu site (na maioria dos temas). A maioria das pessoas começa com uma página de introdução aos potenciais visitantes do site. Ela pode ser assim:\n\n<blockquote>Olá! Eu sou um bike courrier de dia, ator amador à noite e este é meu blog. Eu moro em São Paulo, tenho um cachorro chamado Tonico e eu gosto de caipirinhas. (E de ser pego pela chuva.)</blockquote>\n\nou assim:\n\n<blockquote>A XYZ foi fundada em 1971 e desde então vem proporcionando produtos de qualidade a seus clientes. Localizada em Valinhos, XYZ emprega mais de 2.000 pessoas e faz várias contribuições para a comunidade local.</blockquote>\nComo um novo usuário do WordPress, você deve ir até o <a href="http://corporeum.com.br/inverno13/wp-admin/">seu painel</a> para excluir essa página e criar novas páginas com seu próprio conteúdo. Divirta-se!', 'Página de Exemplo', '', 'trash', 'open', 'open', '', 'pagina-exemplo', '', '', '2013-02-20 20:15:42', '2013-02-20 20:15:42', '', 0, 'http://corporeum.com.br/inverno13/?page_id=2', 0, 'page', '', 0),
(5, 1, '2013-02-20 20:15:38', '2013-02-20 20:15:38', '', 'Início', '', 'publish', 'closed', 'closed', '', 'inicio', '', '', '2013-02-20 21:07:33', '2013-02-20 21:07:33', '', 0, 'http://corporeum.com.br/inverno13/?page_id=5', 0, 'page', '', 0),
(6, 1, '2013-02-20 20:16:03', '2013-02-20 20:16:03', '<img class="alignright size-full wp-image-29" id="img_amarca" alt="foto A Marca" src="http://corporeum.com.br/inverno13/wp-content/themes/corporeum/img/content/amarca.jpg" width="402" height="463" />A história da Corporeum começa com o mix talentoso de duas irmãs, Ritta e Christina Sobral, que não tiveram dúvida em abdicar de suas profissões – advocacia e psicologia –, para se especializar em moda, e ousaram ao criar a marca cujo nome já indicia um chamado à feminilidade e à sensualidade.\r\n\r\nLançada em Ipanema, Rio de Janeiro, e comercializada nas principais vitrines do Brasil, a Corporeum prima por coleções elaboradas na dualidade de estilos de suas criadoras, onde o clássico e o atemporal se aliam ao espírito inovador e contemporâneo, pontuando o verdadeiro DNA carioca – uma sofisticação despojada.\r\n\r\nO resultado dessa mescla revela uma harmonia irresistivelmente encantadora quando desvela, nas principais revistas e jornais do país, a alquimia que a moda traz.', 'A Marca', '', 'publish', 'closed', 'open', '', 'a-marca', '', '', '2013-03-07 20:10:48', '2013-03-07 20:10:48', '', 0, 'http://corporeum.com.br/inverno13/?page_id=6', 1, 'page', '', 0),
(7, 1, '2013-02-20 20:16:10', '2013-02-20 20:16:10', '<img id="img_release" class="alignright size-full wp-image-29" alt="equipe" src="http://corporeum.com.br/inverno13/wp-content/uploads/2013/02/equipe.jpg" width="493" height="326" />\r\n\r\n<p>Um universo de luxo e sofisticação envolve o palácio da família real Orange-Nassau. A Corporeum se inspira nos suntuosos jardins de Het Loo e viaja através da história pelo cenário que abrigou um dos diamantes mais cobiçados, o ''''Queen of Holland''''.\r\n<br /><br />\r\nA elegante residência da rainha Wilhelmina e sua arquitetura barroca holandesa é traduzida nos brocados dourados e na valorização das curvas ora em shapes ora em tecidos devorados. \r\n<br /><br />\r\nAs produções com pedrarias refletem o espírito da realeza. O tom das esmeraldas saem das gemas e colorem as roupas. Da lapidação perfeita do Queen of Holland, surgem  as linhas retas e as formas geométricas que serão o ponto alto desta coleção.\r\n<br /><br />\r\nExplore os salões de bailes mais sofisticados dos Países Baixos e surpreenda-se com o mood glam das jóias e vestidos minuciosamente trabalhados em tecidos ricos e estruturados, garantindo o poder do dress to impress. \r\n<br /><br />\r\nDurante o dia, um passeio pelo jardim é uma viagem ao passado. Transporte-se para um clima lust hof  e contemple o paradoxo das formas geométricas retas e as curvas orgânicas, unidas com muita sintonia pelo mestre paisagista Claude Desgots. \r\n<br /><br />\r\nA cor da paixão domina esta estação. As tramas quentes e os romances entre reis, rainhas e amantes é impressa no vermelho scarlet. Os red shades são a personificação dos amores e do poder da corte.\r\n<br /><br />\r\nO peplum aparece up and down fazendo referência a modelagem dos vestidos da época. Já o tomara que caia está de volta dando destaque aos ombros, que eram e serão muito valorizados de maneira sofisticada e elegante. \r\n<br /><br />\r\nO blend entre materiais como tweed, couro e organza criam looks marcantes e originais. O poder absoluto é celebrado com muito preto. Nesta black celebration, aperecem os veludos, tules e os tecidos texturizados.\r\n<br /><br />\r\nEmbarque nessa viagem a Amsterdan e visite Het Loo, o cenário inspirador do inverno Corporeum 2013.\r\n</p>\r\n', 'Release', '', 'publish', 'closed', 'open', '', 'release', '', '', '2013-02-21 20:34:18', '2013-02-21 20:34:18', '', 0, 'http://corporeum.com.br/inverno13/?page_id=7', 2, 'page', '', 0),
