(75, 1, '2013-02-20 22:55:03', '2013-02-20 22:55:03', '<img class="alignright size-full wp-image-52" alt="c-consciencia" src="http://corporeum.com.br/inverno13/wp-content/uploads/2013/02/c-consciencia.png" width="281" height="277" />O objetivo do selo Corporeum Consciência é comunicar ações da empresa voltadas à sustentabilidade e responsabilidade social. Fornecedores comprometidos com o meio ambiente, produtos e embalagens recicladas foram algumas das ações implementadas pelo selo.\r\n\r\nO esforço em conscientizar a todos sobre a importância do tema levou a empresa a fechar uma parceria com o artista plástico Frans Krajcberg, um ávido defensor da natureza, que luta contra as queimadas na Amazônia. Para o projeto Corporeum Arte &amp; Natureza foi criada uma camiseta e parte da venda revertida à Fundação SOS Mata-Atlântica, contando com o apoio de diversas celebridades.', 'C.Consciência', '', 'inherit', 'closed', 'closed', '', '13-revision-3', '', '', '2013-02-20 22:55:03', '2013-02-20 22:55:03', '', 13, 'http://corporeum.com.br/inverno13/?p=75', 0, 'revision', '', 0),
