(77, 1, '2013-02-21 20:24:07', '2013-02-21 20:24:07', '<img id="img_release" class="alignright size-full wp-image-29" alt="equipe" src="http://corporeum.com.br/inverno13/wp-content/uploads/2013/02/equipe.jpg" width="493" height="326" />\n\n<p>Um universo de luxo e sofisticação envolve o palácio da família real Orange-Nassau. A Corporeum se inspira nos suntuosos jardins de Het Loo e viaja através da história pelo cenário que abrigou um dos diamantes mais cobiçados, o ''''Queen of Holland''''.\n<br /><br />\nA elegante residência da rainha Wilhelmina e sua arquitetura barroca holandesa é traduzida nos brocados dourados e na valorização das curvas ora em shapes ora em tecidos devorados. \n<br /><br />\nAs produções com pedrarias refletem o espírito da realeza. O tom das esmeraldas saem das gemas e colorem as roupas. Da lapidação perfeita do Queen of Holland, surgem  as linhas retas e as formas geométricas que serão o ponto alto desta coleção.\n<br /><br />\nExplore os salões de bailes mais sofisticados dos Países Baixos e surpreenda-se com o mood glam das jóias e vestidos minuciosamente trabalhados em tecidos ricos e estruturados, garantindo o poder do dress to impress. \n<br /><br />\nDurante o dia, um passeio pelo jardim é uma viagem ao passado. Transporte-se para um clima lust hof  e contemple o paradoxo das formas geométricas retas e as curvas orgânicas, unidas com muita sintonia pelo mestre paisagista Claude Desgots. \n<br /><br />\nA cor da paixão domina esta estação. As tramas quentes e os romances entre reis, rainhas e amantes é impressa no vermelho scarlet. Os red shades são a personificação dos amores e do poder da corte.\n<br /><br />\nO peplum aparece up and down fazendo referência a modelagem dos vestidos da época. Já o tomara que caia está de volta dando destaque aos ombros, que eram e serão muito valorizados de maneira sofisticada e elegante. \n<br /><br />\nO blend entre materiais como tweed, couro e organza criam looks marcantes e originais. O poder absoluto é celebrado com muito preto. Nesta black celebration, aperecem os veludos, tules e os tecidos texturizados.\n<br /><br />\nEmbarque nessa viagem a Amsterdan e visite Het Loo, o cenário inspirador do inverno Corporeum 2013.\n</p>\n', 'Release', '', 'inherit', 'closed', 'closed', '', '7-autosave', '', '', '2013-02-21 20:24:07', '2013-02-21 20:24:07', '', 7, 'http://corporeum.com.br/inverno13/?p=77', 0, 'revision', '', 0),
(78, 1, '2013-02-20 20:31:45', '2013-02-20 20:31:45', '<img src="http://corporeum.com.br/inverno13/wp-content/uploads/2013/02/equipe.jpg" alt="equipe" width="493" height="326" class="alignright size-full wp-image-29" />A história da Corporeum começa com o mix talentoso de duas irmãs, Ritta e Christina Sobral, que não tiveram dúvida em abdicar de suas profissões – advocacia e psicologia –, para se especializar em moda, e ousaram ao criar a marca cujo nome já indicia um chamado à feminilidade e à sensualidade.\r\n\r\nLançada em Ipanema, Rio de Janeiro, e comercializada nas principais vitrines do Brasil, a Corporeum prima por coleções elaboradas na dualidade de estilos de suas criadoras, onde o clássico e o atemporal se aliam ao espírito inovador e contemporâneo, pontuando o verdadeiro DNA carioca – uma sofisticação despojada.\r\n\r\nO resultado dessa mescla revela uma harmonia irresistivelmente encantadora quando desvela, nas principais revistas e jornais do país, a alquimia que a moda traz.', 'Release', '', 'inherit', 'closed', 'closed', '', '7-revision', '', '', '2013-02-20 20:31:45', '2013-02-20 20:31:45', '', 7, 'http://corporeum.com.br/inverno13/?p=78', 0, 'revision', '', 0),
(79, 1, '2013-02-21 20:18:08', '2013-02-21 20:18:08', '<img class="alignright size-full wp-image-29" alt="equipe" src="http://corporeum.com.br/inverno13/wp-content/uploads/2013/02/equipe.jpg" width="493" height="326" />\r\n\r\n<p>Um universo de luxo e sofisticação envolve o palácio da família real Orange-Nassau. A Corporeum se inspira nos suntuosos jardins de Het Loo e viaja através da história pelo cenário que abrigou um dos diamantes mais cobiçados, o ''''Queen of Holland''''.<br /><br />\r\nA elegante residência da rainha Wilhelmina e sua arquitetura barroca holandesa é traduzida nos brocados dourados e na valorização das curvas ora em shapes ora em tecidos devorados. \r\nAs produções com pedrarias refletem o espírito da realeza. O tom das esmeraldas saem das gemas e colorem as roupas. Da lapidação perfeita do Queen of Holland, surgem  as linhas retas e as formas geométricas que serão o ponto alto desta coleção.<br /><br />\r\nExplore os salões de bailes mais sofisticados dos Países Baixos e surpreenda-se com o mood glam das jóias e vestidos minuciosamente trabalhados em tecidos ricos e estruturados, garantindo o poder do dress to impress. \r\nDurante o dia, um passeio pelo jardim é uma viagem ao passado. Transporte-se para um clima lust hof  e contemple o paradoxo das formas geométricas retas e as curvas orgânicas, unidas com muita sintonia pelo mestre paisagista Claude Desgots. <br /><br />\r\nA cor da paixão domina esta estação. As tramas quentes e os romances entre reis, rainhas e amantes é impressa no vermelho scarlet. Os red shades são a personificação dos amores e do poder da corte.<br /><br />\r\nO peplum aparece up and down fazendo referência a modelagem dos vestidos da época. Já o tomara que caia está de volta dando destaque aos ombros, que eram e serão muito valorizados de maneira sofisticada e elegante.\r\nO blend entre materiais como tweed, couro e organza criam looks marcantes e originais. O poder absoluto é celebrado com muito preto. Nesta black celebration, aperecem os veludos, tules e os tecidos texturizados.\r\nEmbarque nessa viagem a Amsterdan e visite Het Loo, o cenário inspirador do inverno Corporeum 2013.\r\n</p>\r\n', 'Release', '', 'inherit', 'closed', 'closed', '', '7-revision-2', '', '', '2013-02-21 20:18:08', '2013-02-21 20:18:08', '', 7, 'http://corporeum.com.br/inverno13/?p=79', 0, 'revision', '', 0),
