(422, 1, '2013-03-04 19:12:21', '2013-03-04 19:12:21', 'Cadastre-se e receba informações exclusivas sobre lançamentos, eventos, promoções, dicas de produção de moda e novidades Corporeum.\r\n\r\n<ul id="enderecos_contato">\r\n\r\n	<li>\r\n		<h2>Departamento comercial</h2>\r\n		<p>Rua Visconde de Itaboraí, 166/601\r\n		Niterói - Rio de Janeiro\r\n		Tel. 21 2621.8945</p>\r\n	</li>\r\n\r\n	<li>\r\n		<h2>Showroom Rio de Janeiro</h2>\r\n		<p>Rua Visconde de Pirajá, 437\r\n		2º andar\r\n		Tel. 21 2540.5764 / 2511.1141</p>\r\n	</li>\r\n\r\n	<li>\r\n		<h2>Assessoria de imprensa</h2>\r\n		<p>Plano 1 Comunicação\r\n		2547.3363 | 2256.4347</p>\r\n	</li>\r\n\r\n</ul>\r\n\r\n\r\n<form id="formulario_contato" action="contato.php" method="post" name="contatoviasite">\r\n          \r\n           <fieldset>\r\n\r\n                <label for="dpto">Selecione o departamento que deseja falar:</label>\r\n                <select size="1" name="dpto">\r\n                  <option value="Selecione" selected>Selecione</option>\r\n                  <option value="Onde Encontrar">Onde Encontrar</option>\r\n                  <option value="Atendimento ao Cliente">Atendimento ao Cliente</option>\r\n                  <option value="Marketing">Marketing</option>\r\n                  <option value="RH">RH</option>\r\n                  <option value="Showroom / Vendas">Showroom / Vendas</option>\r\n    		</select>\r\n\r\n                <label for="nome">Nome*</label>\r\n                <input name="nome" type="text" size="31" required aria-required="true"/>\r\n                <label for="cpf">CPF</label>\r\n                <input name="cpf" type="text" size="31"/>\r\n                <label for="email">E-mail*</label>\r\n                <input name="email" type="email" size="31" required aria-required="true"/>\r\n                <p>* Campos obrigatórios</p>\r\n               \r\n            </fieldset>\r\n            <fieldset>\r\n         \r\n                <label for="telefone">Telefone</label>\r\n                <input name="ddd" type="text" id="input_ddd" /> \r\n                <input name="telefone" type="text" id="input_tel" />\r\n                <label for="cidade">Cidade</label>\r\n                <input name="cidade" type="text" size="33"/>\r\n                <label for="estado">Estado</label>\r\n                <input name="estado" type="text" size="3"/>\r\n                <label for="mensagem">Mensagem*</label>\r\n                <textarea name="mensagem" cols="32" rows="5" type="text" required aria-required="true"></textarea>\r\n                <button type="submit">Enviar</button>\r\n            \r\n            </fieldset>\r\n\r\n</form>\r\n\r\n', 'Contato', '', 'inherit', 'closed', 'closed', '', '16-revision-16', '', '', '2013-03-04 19:12:21', '2013-03-04 19:12:21', '', 16, 'http://corporeum.com.br/inverno13/?p=422', 0, 'revision', '', 0),
(424, 1, '2013-02-21 15:51:01', '2013-02-21 15:51:01', '<img class="alignright size-full wp-image-52" alt="c-consciencia" src="http://corporeum.com.br/inverno13/wp-content/uploads/2013/02/c-consciencia.png" width="281" height="277" />O objetivo do selo Corporeum Consciência é comunicar ações da empresa voltadas à sustentabilidade e responsabilidade social. Fornecedores comprometidos com o meio ambiente, produtos e embalagens recicladas foram algumas das ações implementadas pelo selo.\r\n\r\nO esforço em conscientizar a todos sobre a importância do tema levou a empresa a fechar uma parceria com o artista plástico Frans Krajcberg, um ávido defensor da natureza, que luta contra as queimadas na Amazônia. Para o projeto Corporeum Arte &amp; Natureza foi criada uma camiseta e parte da venda revertida à Fundação SOS Mata-Atlântica, contando com o apoio de diversas celebridades.', 'C.Consciência', '', 'inherit', 'closed', 'closed', '', '13-revision-4', '', '', '2013-02-21 15:51:01', '2013-02-21 15:51:01', '', 13, 'http://corporeum.com.br/inverno13/?p=424', 0, 'revision', '', 0),
