(540, 1, '2013-03-04 20:13:48', '2013-03-04 20:13:48', 'Cadastre-se e receba informações exclusivas sobre lançamentos, eventos, promoções, dicas de produção de moda e novidades Corporeum.\r\n\r\n<ul id="enderecos_contato">\r\n\r\n	<li>\r\n		<h2>Departamento comercial</h2>\r\n		<p>Rua Visconde de Itaboraí, 166/601\r\n		Niterói - Rio de Janeiro\r\n		Tel. 21 2621.8945</p>\r\n	</li>\r\n\r\n	<li>\r\n		<h2>Showroom Rio de Janeiro</h2>\r\n		<p>Rua Visconde de Pirajá, 437\r\n		2º andar\r\n		Tel. 21 2540.5764 / 2511.1141</p>\r\n	</li>\r\n\r\n	<li>\r\n		<h2>Assessoria de imprensa</h2>\r\n		<p>Plano 1 Comunicação\r\n		2547.3363 | 2256.4347</p>\r\n	</li>\r\n\r\n</ul>\r\n\r\n\r\n<form id="formulario_contato" action="contato.php" method="post" name="contatoviasite">\r\n          \r\n           <fieldset>\r\n\r\n                <label for="dpto">Selecione o departamento que deseja falar:</label>\r\n                <select size="1" name="dpto">\r\n                  <option value="Selecione" selected>Selecione</option>\r\n                  <option value="Onde Encontrar">Onde Encontrar</option>\r\n                  <option value="Atendimento ao Cliente">Atendimento ao Cliente</option>\r\n                  <option value="Marketing">Marketing</option>\r\n                  <option value="RH">RH</option>\r\n                  <option value="Showroom / Vendas">Showroom / Vendas</option>\r\n    		</select>\r\n\r\n                <label for="nome">Nome*</label>\r\n                <input name="nome" type="text" size="31" required aria-required="true"/>\r\n                <label for="cpf">CPF</label>\r\n                <input name="cpf" type="text" size="31"/>\r\n                <label for="email">E-mail*</label>\r\n                <input name="email" type="email" size="31" required aria-required="true"/>\r\n                <p>* Campos obrigatórios</p>\r\n               \r\n            </fieldset>\r\n            <fieldset>\r\n         \r\n                <label for="telefone">Telefone</label>\