(883, 1, '2013-02-21 20:49:55', '2013-02-21 20:49:55', '<img id="img_amarca" class="alignright size-full wp-image-29" alt="foto A Marca" src="http://corporeum.com.br/inverno13/wp-content\\themes\\corporeum\\img\\content/amarca.jpg" width="402" height="463" />A história da Corporeum começa com o mix talentoso de duas irmãs, Ritta e Christina Sobral, que não tiveram dúvida em abdicar de suas profissões – advocacia e psicologia –, para se especializar em moda, e ousaram ao criar a marca cujo nome já indicia um chamado à feminilidade e à sensualidade.\r\n\r\nLançada em Ipanema, Rio de Janeiro, e comercializada nas principais vitrines do Brasil, a Corporeum prima por coleções elaboradas na dualidade de estilos de suas criadoras, onde o clássico e o atemporal se aliam ao espírito inovador e contemporâneo, pontuando o verdadeiro DNA carioca – uma sofisticação despojada.\r\n\r\nO resultado dessa mescla revela uma harmonia irresistivelmente encantadora quando desvela, nas principais revistas e jornais do país, a alquimia que a moda traz.', 'A Marca', '', 'inherit', 'closed', 'closed', '', '6-revision-4', '', '', '2013-02-21 20:49:55', '2013-02-21 20:49:55', '', 6, 'http://corporeum.com.br/inverno13/?p=883', 0, 'revision', '', 0),
